import React, { useEffect } from "react";

const {naver} = window;

const NaverMap = () => {
    useEffect(() => {
        const mapDiv = document.getElementById('myNaverMap');
        const map = new window.naver.maps.Map(mapDiv);
    }, [])


    return (
        <div id="myNaverMap" style={{width:'100%', height:'100%', position:'relative', overflow:'hidden'}}></div>
    )
}

export default NaverMap;
